import React from "react";
import "./social.css";
const Social = () => {
  return (
    <div className="home__social">
      <a href="https://www.linkedin.com/in/varun-poojary7/" className="home__social-icon" target="_blank">
      <i class='bx bxl-linkedin' ></i>
      </a>

      <a href="https://twitter.com/Powxu_XD" className="home__social-icon" target="_blank">
        <i class="uil uil-twitter"></i>

        <a href="https://iconscout.com/icons/leetcode" target="_blank">Free Leetcode Logo Icon</a> by <a href="https://iconscout.com/contributors/icon-54">Icon 54</a> on <a href="https://iconscout.com">IconScout</a>
      </a>

      <a href="https://github.com/VarunPoojary" className="home__social-icon" target="_blank">
        <i class="uil uil-github-alt"></i>
      </a>
    </div>
  );
};

export default Social;
